#!/usr/bin/env python3
"""
Clicker Server - WebSocket server for remote Option key control

Usage:
    python clicker_server.py              # Default: QR points to Vercel PWA
    python clicker_server.py --local      # Offline: Serves embedded PWA locally

The script runs a WebSocket server for key control (WS on port 8765).
In --local mode, it also serves the embedded PWA (HTTP on port 8080).

Requirements are auto-installed on first run.
"""

