# Platform-specific keyboard control
import platform as _platform
if _platform.system() == "Darwin":
    # macOS: Use Quartz for reliable modifier key simulation
    from Quartz import (
        CGEventCreateKeyboardEvent,
        CGEventSetFlags,
        CGEventPost,
        kCGHIDEventTap,
        kCGEventFlagMaskAlternate,
    )

    class MacKeyboard:
        """macOS keyboard controller using Quartz CGEvents."""
        def __init__(self):
            self.option_held = False

        def press_option(self):
            """Press and hold the RIGHT Option key."""
            # Create a flagsChanged event with Option modifier
            event = CGEventCreateKeyboardEvent(None, 61, True)  # 61 = RIGHT Option key
            CGEventSetFlags(event, kCGEventFlagMaskAlternate)
            CGEventPost(kCGHIDEventTap, event)
            self.option_held = True

        def release_option(self):
            """Release the RIGHT Option key."""
            # Create a flagsChanged event without Option modifier
            event = CGEventCreateKeyboardEvent(None, 61, False)  # 61 = RIGHT Option key
            CGEventSetFlags(event, 0)
            CGEventPost(kCGHIDEventTap, event)
            self.option_held = False

    keyboard = MacKeyboard()

    def press_key():
        keyboard.press_option()

    def release_key():
        keyboard.release_option()

else:
    # Windows/Linux: Use pynput
    from pynput.keyboard import Key, Controller
    keyboard = Controller()
    OPTION_KEY = Key.alt

    def press_key():
        keyboard.press(OPTION_KEY)

    def release_key():
        keyboard.release(OPTION_KEY)


def get_local_ip():
    """Get the local IP address for LAN connections."""
    try:
        s = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)
        s.connect(("8.8.8.8", 80))
        ip = s.getsockname()[0]
        s.close()
        return ip
    except Exception:
        return "127.0.0.1"


def print_qr_code(url):
    """Print QR code to terminal."""
    qr = qrcode.QRCode(
        version=1,
        error_correction=qrcode.constants.ERROR_CORRECT_L,
        box_size=1,
        border=2,
    )
    qr.add_data(url)
    qr.make(fit=True)
    qr.print_ascii(invert=True)


