class ClickerServer:
    def __init__(self, ws_port=8765, http_port=8080, local_mode=False):
        self.ws_port = ws_port
        self.http_port = http_port
        self.local_mode = local_mode
        self.key_held = False
        self.current_client = None

    async def handle_client(self, websocket):
        """Handle a WebSocket client connection."""
        client_addr = websocket.remote_address

        # Only allow one client at a time
        if self.current_client is not None:
            print(f"[!] Replacing existing client with new connection from {client_addr}")
            # Release key if held by previous client
            if self.key_held:
                release_key()
                self.key_held = False
                print("[KEY] Option key RELEASED (client replaced)")

        self.current_client = websocket
        PWAHandler.connected_client = client_addr[0]  # Update status for QR page
        print(f"[+] Client connected: {client_addr}")

        try:
            async for message in websocket:
                try:
                    data = json.loads(message)
                    action = data.get("action")

                    if action == "key_down":
                        if not self.key_held:
                            press_key()
                            self.key_held = True
                            print("[KEY] Option key PRESSED (holding)")
                            await websocket.send(json.dumps({"status": "key_down_ok"}))

                    elif action == "key_up":
                        if self.key_held:
                            release_key()
                            self.key_held = False
                            print("[KEY] Option key RELEASED")
                            await websocket.send(json.dumps({"status": "key_up_ok"}))

                    else:
                        print(f"[?] Unknown action: {action}")

                except json.JSONDecodeError:
                    print(f"[!] Invalid JSON: {message}")

        except websockets.exceptions.ConnectionClosed:
            pass
        finally:
            # Release key when client disconnects
            if self.key_held:
                release_key()
                self.key_held = False
                print("[KEY] Option key RELEASED (client disconnected)")

            if self.current_client == websocket:
                self.current_client = None
                PWAHandler.connected_client = None  # Update status for QR page
            print(f"[-] Client disconnected: {client_addr}")

    async def run(self):
        """Start the server(s)."""
        local_ip = get_local_ip()
        ws_url = f"ws://{local_ip}:{self.ws_port}"
        http_url = f"http://{local_ip}:{self.http_port}"

        # In local mode, start HTTP server for embedded PWA
        if self.local_mode:
            http_thread = threading.Thread(
                target=run_http_server,
                args=(self.http_port, ws_url),
                daemon=True
            )
            http_thread.start()
            # QR points to local HTTP server
            qr_url = f"{http_url}?server={ws_url}"
            pwa_url = http_url
        else:
            # QR points to Vercel-hosted PWA with WebSocket URL as parameter
            qr_url = f"{VERCEL_URL}?server={ws_url}"
            pwa_url = VERCEL_URL

        print()
        print("=" * 54)
        print("         OPTION KEY REMOTE SERVER")
        print("=" * 54)
        print(f"\n  Platform:  {platform.system()}")
        print(f"  Mode:      {'Local (embedded PWA)' if self.local_mode else 'Online (Vercel PWA)'}")
        print(f"  WebSocket: {ws_url}")
        if self.local_mode:
            print(f"  HTTP:      {http_url}")
        print()
        print("-" * 54)
        print("  Scan this QR code with your iPhone:")
        print("-" * 54)
        print()
        print_qr_code(qr_url)
        print()
        print("-" * 54)
        print(f"  Or open Safari on iPhone:")
        print(f"  {pwa_url}")
        if not self.local_mode:
            print(f"\n  Then enter your Mac's IP: {local_ip}")
        print("-" * 54)
        print("\n  Waiting for connections... (Ctrl+C to quit)\n")

        async with websockets.serve(self.handle_client, "0.0.0.0", self.ws_port):
            await asyncio.Future()


