def get_hostname():
    """Get the local hostname (e.g., 'Jakes-MacBook-Pro.local')."""
    try:
        hostname = socket.gethostname()
        # On macOS, ensure it ends with .local
        if platform.system() == "Darwin" and not hostname.endswith('.local'):
            hostname = hostname.replace('.local', '') + '.local'
        return hostname
    except Exception:
        return "localhost"


def main():
    import argparse
    parser = argparse.ArgumentParser(description="Clicker Server - Option Key Remote")
    parser.add_argument("--ws-port", "-w", type=int, default=8765,
                        help="WebSocket port (default: 8765)")
    parser.add_argument("--http-port", "-p", type=int, default=8080,
                        help="HTTP port (default: 8080)")
    parser.add_argument("--no-browser", action="store_true",
                        help="Don't auto-open browser with QR code")
    args = parser.parse_args()

    local_ip = get_local_ip()
    hostname = get_hostname()
    qr_url = f"http://{local_ip}:{args.http_port}/qr"

    # macOS: warn about accessibility permissions
    if platform.system() == "Darwin":
        print()
        print("!" * 54)
        print("  IMPORTANT: macOS Accessibility Permission Required")
        print("!" * 54)
        print("""
  If key simulation doesn't work:
  1. Open System Settings > Privacy & Security
  2. Click on Accessibility
  3. Enable this app (or Terminal if running from terminal)
  4. You may need to restart this script
""")

    # Open browser to QR code page
    if not args.no_browser:
        print(f"Opening browser to: {qr_url}")
        # Small delay to let server start
        def open_browser():
            import time
            time.sleep(1)
            webbrowser.open(qr_url)
        browser_thread = threading.Thread(target=open_browser, daemon=True)
        browser_thread.start()

    # Run server (local mode always - serves embedded PWA)
    server = ClickerServer(ws_port=args.ws_port, http_port=args.http_port, local_mode=True)
    try:
        asyncio.run(server.run())
    except KeyboardInterrupt:
        print("\nServer stopped.")


if __name__ == "__main__":
    main()
